import React from 'react'

const Navbar = () => {
  return (
    <div className=' text-white'>
        <h1 className=' w-full text-3xl font-bold text-[#00df9a]'>REACT.</h1>
        <ul className=' flex'>
            <li className=' p-4 bg-blue-500'>Home</li>
            <li className=' p-4 bg-blue-500'>Company</li>
            <li className=' p-4 bg-blue-500'>Resources</li>
            <li className=' p-4 bg-blue-500'>About</li>
            <li className=' p-4 bg-blue-500'>Contact</li>
        </ul>
    </div>
  )
}

export default Navbar;
